import "./App.css";
import React from "react";

function Course(props) {
  return (
    <div>
      <ul>
        <li>{props.courseName}</li>
      </ul>
    </div>
  )
}

function App() {

  return (
    <div>
      <h1>Guvi Courses</h1>
      <Course courseName="Full Stack Development" />
    </div>
  );
}

export default App;
